import * as BABYLON from "babylonjs";
import * as GUI from "babylonjs-gui";
import App from "./index";
import Tile from "./tile";

export class Environment {
  public scene: BABYLON.Scene;

  public app: App;
  public tile: Tile;

  // Sprite variables
  public background: BABYLON.Mesh;
  // public table1: BABYLON.Mesh;
  public table1: GUI.Image;

  public spriteBackgroundPath: string =
    "data:image/png;base64,";
  
    public tableSpritePath: string =
    "data:image/png;base64,";

  constructor(scene: BABYLON.Scene, app: App) {
    this.background;
    this.scene = scene;
    this.app = app;
    this.load();
  }

  public async load() {
    this.setEnvironmentElements();
  }

  public setEnvironmentElements() {
    // // Set background visual
    this.background = BABYLON.Mesh.CreatePlane("background", 1, this.scene);
    var backgroundMat = new BABYLON.StandardMaterial(
      "backgroundMat",
      this.scene
    );
    backgroundMat.diffuseTexture = new BABYLON.Texture(
      this.spriteBackgroundPath,
      this.scene
    );
    this.background.material = backgroundMat;
    this.background.position = new BABYLON.Vector3(0, 3, 1);
    this.background.scaling = new BABYLON.Vector3(16, 35, 1);

    // this.table1 = BABYLON.Mesh.CreatePlane("table1", 1, this.scene);
    // var table1Mat = new BABYLON.StandardMaterial("table1Mat", this.scene);
    // table1Mat.diffuseTexture = new BABYLON.Texture(
    //   this.tableSpritePath,
    //   this.scene
    // );
    // this.table1.material = table1Mat;
    // this.table1.position = new BABYLON.Vector3(0, 10, 0);
    // this.table1.scaling = new BABYLON.Vector3(15, 15, 1);
    // console.log(this.table1);


    this.table1 = new GUI.Image("tile", this.tableSpritePath);
    this.table1.width = "340px";
    this.table1.height = "340px";
    this.table1.top = 50;
    this.table1.left = 25;
    this.table1.horizontalAlignment = GUI.Control.HORIZONTAL_ALIGNMENT_LEFT;
    this.table1.verticalAlignment = GUI.Control.VERTICAL_ALIGNMENT_TOP;

    this.app.gameUI.addControl(this.table1);


  }
}
